import React, { Component } from 'react';
import Cookies from 'js-cookie';

class newRecord extends Component{
    state = {
        owner: Cookies.get('name'),
        errors: {}
    }


    render(){
        return(
            <div>
                <p> Creating new record for {this.state.name}...</p>
            </div>
        )
    }
}

export default newRecord;
